(function() {
  var startTime = new Date()
  setTimeout(pageStay, 1000 * 60 * 60)
  $(window).on('unload', pageStay)

  var match = navigator.userAgent.toLowerCase().match(/vipkid\/(\d+.\d+.\d+)/)
  var uaVer = match ? match[1] : null
  var uaClass = match ? 'client' : 'browser'

  //增加统计页面停留时长，最大时常为1小时
  function pageStay() {
    $(window).off('unload', pageStay)
    var endTime = new Date();
    var duration = (endTime.getTime() - startTime.getTime()) / 1000;
    sa.track('pc_page_stay', {
      page_stay_duration: duration
    });
  };

  //getCookie&setCookie&delCookie
  function getCookie(c_name) {
    if ($.type($.cookie) == 'function') {
      return $.cookie(c_name);
    }

    var c_start, c_end;　　　
    if (document.cookie.length > 0) {　　　　　　
      var c_start = document.cookie.indexOf(c_name + "=");
      if (c_start != -1) {　　　　　　　　
        c_start = c_start + c_name.length + 1;　　　　　　　　
        c_end = document.cookie.indexOf(";", c_start);　　　　　　　　
        if (c_end == -1) {
          c_end = document.cookie.length;
        }
        return unescape(document.cookie.substring(c_start, c_end))
      }
    }
    return ""
  }

  function setCookie(c_name, value, expiredays) {
    if ($.type($.cookie) == 'function') {
      $.cookie(c_name, value, {
        expires: expiredays
      });
      return;
    }
    var exdate = new Date();　　
    exdate.setDate(exdate.getDate() + expiredays);　　
    document.cookie = c_name + "=" + escape(value) + ((expiredays == null) ? "" : ";expires=" + exdate.toGMTString());
  }

  function delCookie(name) {
    if ($.type($.cookie) == 'function') {
      $.removeCookie(c_name);
      return;
    }
    var exp = new Date();
    exp.setTime(exp.getTime() - 1);
    var cval = getCookie(name);
    if (cval != null) document.cookie = name + "=" + cval + ";expires=" + exp.toGMTString();
  }

  var VipKidLog = function() {
    //初始化
    this.init();
  };
  //初始化
  VipKidLog.prototype.init = function() {
    //为了避免开发的时候不停地给神策发送数据
    //当url中包含debug的时候停止发送数据
    var search = location.search;
    if (/debug=(true|1)/.test(search)) {
      return false
    }
    //神策系统必须是1.4最新版及以上
    //完成两个功能
    //一个判断是否是首次访问用户统计首次访问时间，首次访问时的来源以及来源的域名
    //第二个会 track('$pageview') 事件，将其添加到需要的页面中就可以完成不同网页自动追踪 PV ，包含统计来源，来源域名， url ，网页标题，浏览器支持的语言等属性。
    sa.quick('autoTrack');
    //注册公共携带属性
    this.register();
    this.sendPrevpageLog();
    this.addEventListener();
  }

  //绑定监听事件
  VipKidLog.prototype.addEventListener = function() {
    $('body').off('click.log');
    var self = this;
    $('body').on('click.log', '[data-sa-click]', function(e) {
      var logName = 'pc_click'
      var logValues = {
        click_id: $(this).attr('data-sa-click'),
        $referrer: document.referrer,
        $url: location.href,
        $url_path: location.pathname,
        $title: document.title,
        $browser_language: navigator.language
      }

      if (self.isRealLink(this)) {
        setCookie('unSendedLog', JSON.stringify({
          name: logName,
          values: logValues
        }));
        return;
      }
      sa.track(logName, logValues)
    })
  };

  //如果是可能可以跳转的a连接
  VipKidLog.prototype.isRealLink = function(dom) {
    var tagName = dom.tagName.toLowerCase();
    var href = dom.href;

    if (tagName !== 'a') {
      return false;
    } else if (href === '#') {
      return false;
    } else if (href.indexOf('javascript') != -1) {
      return false;
    }

    return true;
  };

  //发送上一个页面Cookie
  VipKidLog.prototype.sendPrevpageLog = function() {
    var cookieStr = getCookie('unSendedLog');
    if (!cookieStr) {
      return false;
    }

    try{
      var cookieObj = JSON.parse(cookieStr);
      sa.track(cookieObj.name, cookieObj.values);
    } catch (e) {
    }
    delCookie('unSendedLog');
  }

  //定义公共属性 每个打点都携带
  VipKidLog.prototype.register = function() {
    sa.register({
      parent_id: getCookie('parentId') || '',
      student_id: getCookie('studentId') || '',
      'client': uaClass === 'client' ? 'VIPKID_'+uaVer : uaClass,
      'online_class_id': -1,
      'class_id': '',
      $referrer: document.referrer,
      $url: location.href,
      $url_path: location.pathname,
      $title: document.title,
      $browser_language: navigator.language,
      product: 'parent_www',
      vk_session_id: getCookie('vk_session_id') || ''
    });
  }

  new VipKidLog()
})();

